// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

import "./VaultBase.sol";
import "../../interfaces/IUniswapV2Router02.sol";

pragma experimental ABIEncoderV2;

contract StopLossVault is VaultBase {
    IUniswapV2Router02 public router;
    address[] internal path;

    constructor(Settings _settings, IUniswapV2Router02 _router, uint256 _maxTokens) public ERC721("test vault", "tv") {
        require(_maxTokens > 1, "CornFi Stop Loss Vault: Max Tokens Cannot be Less Than 1");
        settings = _settings;
        router = _router;
        maxTokens = _maxTokens;
        owner = msg.sender;

        // Mint a blank strategy to this contract.
        // When referencing 'tokenAmounts[_tokenId][_token]',
        // use '0' for '_tokenId' to keep track of amounts
        // deposited accross all users.
        orders.push();
        strategies.push();
        _mint(address(this), tokenCounter);
        tokenOpenOrderIds.push();
        path.push();
        path.push();
        tokenCounter++;
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    /**
    * @dev 
    * _tokens[0] = from token
    * _tokens[1] = to token
    *
    * _amounts[0] = {required} starting amount
    * _amounts[1] = {required} stop loss price
    *
    * _times = [0] (Not Used)
    */
    function createTrade(address _from, address[] memory _tokens, uint256[] memory _amounts, uint[] memory _times) public onlyController {
        require(tokenCounter < maxTokens, "CornFi Stop Loss Vault: Max Tokens Reached");
        require(_times.length == 1, "CornFi Stop Loss Vault: Time Data Max Exceeded");

        require(_amounts[0].div(_amounts.length.sub(1)) >= settings.minimumDeposit(_tokens[0]), "CornFi Stop Loss Vault: Minimum Deposit Not Met");

        // Only one stop-loss price allowed
        require(_amounts.length <= 5, "CornFi Stop Loss Vault: Max Orders Exceeded");


        // Create the strategy
        _setStrategy(_tokens, _amounts, _times);


        // Transfer deposit amount from user
        IERC20(_tokens[0]).transferFrom(_from, address(this), _amounts[0]);

        IStrategy strat = settings.strategy(_tokens[0]);

        // Deposit fee
        uint256 depositFee = strat.depositFee(_amounts[0]);
        IERC20(_tokens[0]).transfer(settings.Fees(), depositFee);

        // Adjust token amount to include fee
        uint256 amountInWithFee = _amounts[0].sub(depositFee);
        tokenAmounts[tokenCounter][_tokens[0]] = amountInWithFee;

        IERC20(_tokens[0]).approve(address(strat), amountInWithFee);    //
        strat.deposit(address(this), _tokens[0], amountInWithFee);      //

        // Calculate amount in for the orders.
        // The number of sell prices determines how many orders to create.
        // The amount in for the sell orders is the total amount deposited
        // divided by the number of sell prices. Each sell order will have
        // the same amount in.
        //
        // Example:
        //      - amount in: 100 USDC
        //      - to token: WMATIC
        //      - sell price 1: 0.9 WMATIC / 1 USDC
        //      - sell price 2: 0.7 WMATIC / 1 USDC
        //      - sell price 3: 0.5 WMATIC / 1 USDC
        //      - sell price 4: 0.4 WMATIC / 1 USDC
        //
        //  * amount out = amount in / sell price *
        //
        //  Sell order 1: 25 USDC --> 27.77 WMATIC
        //  Sell order 2: 25 USDC --> 35.71 WMATIC
        //  Sell order 3: 25 USDC --> 50 WMATIC
        //  Sell order 4: 25 USDC --> 62.5 WMATIC
        uint256 orderAmountIn = amountInWithFee.div(_amounts.length.sub(1));

        uint256[] memory amounts = _amounts;
        address[] memory tokens = _tokens;

        for(uint i = 1; i < amounts.length; i++) {
            // Create initial order
            _createOrder(tokenCounter, 0, [tokens[0], tokens[1]], [orderAmountIn, 0, _getAmountOut(tokens[0], tokens[1], orderAmountIn, amounts[i])], _times);
        }

        _safeMint(_from, tokenCounter++);
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function fillOrder(address _from, uint256 _orderId) public onlyController {
        Order memory order = orders[_orderId];

        require(order.timestamp == 0, "CornFi Stop Loss Vault: Order is Inactive");

        // Create the trade path
        path[0] = order.tokens[0];
        path[1] = order.tokens[1];

        // Get amount out of trade & account for slippage
        uint256 amountOut = router.getAmountsOut(order.amounts[0], path)[1];
        uint256 minAmountOut = settings.slippage(amountOut);        //amountOut.sub(amountOut.mul(settings.SLIPPAGE_POINTS()).div(settings.SLIPPAGE_BASE_POINTS()));

        // Check if the conditions are met
        require(minAmountOut <= order.amounts[2], "CornFi Stop-Loss Vault: Current Price Too High");

        settings.strategy(order.tokens[0]).withdraw(address(this), order.tokens[0], order.amounts[0]);      //

        // Approve the router and swap tokens
        IERC20(path[0]).approve(address(router), order.amounts[0]);
        uint256 swapAmountOut = router.swapExactTokensForTokens(
            order.amounts[0], 
            minAmountOut, 
            path, 
            address(this), 
            now.add(60)
        )[1];

        // Ensure the order is executed only when the current price falls below the stop price
        require(swapAmountOut <= order.amounts[2], "CornFi Stop-Loss Vault: Current Price Too High");

        IStrategy strat = settings.strategy(order.tokens[1]);

        // Reward the order filler for spending gas to fill this order
        uint256 fillerFee = strat.fillerFee(swapAmountOut);
        IERC20(order.tokens[1]).transfer(_from, fillerFee);

        // Transaction fees
        uint256 txFee = strat.txFee(swapAmountOut);
        IERC20(order.tokens[1]).transfer(settings.Fees(), txFee);

        // Adjust user balance
        orders[_orderId].amounts[1] = swapAmountOut.sub(fillerFee).sub(txFee);

        IERC20(order.tokens[1]).approve(address(strat), orders[order.orderId].amounts[1]);    //
        strat.deposit(address(this), order.tokens[1], orders[order.orderId].amounts[1]);    //

        // Close order, remove from open orders list
        _closeOrderHelper(true, _orderId);
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    function withdraw(address _from, uint256 _tokenId) public onlyController {
        require(ownerOf(_tokenId) == _from, "CornFi Stop Loss Vault: Caller is Not the Token Owner");
        Strategy memory strat = strategies[_tokenId];
        for(uint i = 0; i < strat.tokens.length; i++) {
            if(tokenAmounts[_tokenId][strat.tokens[i]] > 0) {
                settings.strategy(strat.tokens[i]).withdraw(_from, strat.tokens[i], tokenAmounts[_tokenId][strat.tokens[i]]);      //
                tokenAmounts[_tokenId][strat.tokens[i]] = 0;
            }
        }
        uint256[] memory orderIds = tokenOpenOrderIds[_tokenId];
        for(uint j = 0; j < orderIds.length; j++) {
            _removeOpenOrder(orderIds[j]);
            orders[orderIds[j]].timestamp = 1;
        }
        delete tokenOpenOrderIds[_tokenId];
        _burn(_tokenId);
    }


    // --------------------------------------------------------------------------------
    // ------------------------------ Internal Functions ------------------------------
    // --------------------------------------------------------------------------------


    function _closeOrderHelper(bool _fill, uint256 _orderId) internal {
        Order memory order = orders[_orderId];

        if(_fill) {
            // Adjust token amounts
            tokenAmounts[order.tokenId][order.tokens[1]] = tokenAmounts[order.tokenId][order.tokens[1]].add(order.amounts[1]);
        }

        // Adjust token amounts
        tokenAmounts[order.tokenId][order.tokens[0]] = tokenAmounts[order.tokenId][order.tokens[0]].sub(order.amounts[0]);

        // Close trade
        orders[_orderId].timestamp = block.timestamp;

        // Remove open order
        _removeOrder(_fill, _orderId);
    }


    // --------------------------------------------------------------------------------
    // --------------------------------------------------------------------------------


    // function _createOrderHelper(uint256 _tokenId, uint256 _tradeId, address _fromToken, address _toToken, uint256 _amountIn, uint256 _price, uint[] memory _times) internal {
    //     // Subtract fee from token balance
    //     // tokenAmounts[_tokenId][_fromToken] = tokenAmounts[_tokenId][_fromToken];

    //     // Create the order
    //     _createOrder(_tokenId, _tradeId, [_fromToken, _toToken], [_amountIn, 0, _getAmountOut(_fromToken, _toToken, _amountIn, _price)], _times);
    // }
}
